#
# TABLE STRUCTURE FOR: FAQ
#

DROP TABLE IF EXISTS `FAQ`;

CREATE TABLE `FAQ` (
  `id` int(10) unsigned NOT NULL COMMENT 'Номер вопроса',
  `question_name` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Вопрос',
  `answer` text COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Ответ на вопрос',
  PRIMARY KEY (`id`),
  UNIQUE KEY `question_name` (`question_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Таблица с часто задаваемыми вопросами';

#
# TABLE STRUCTURE FOR: ads_services
#

DROP TABLE IF EXISTS `ads_services`;

CREATE TABLE `ads_services` (
  `id` int(10) unsigned NOT NULL COMMENT 'Номер услуги',
  `services_name` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название услуги',
  `premium_block` tinyint(1) unsigned NOT NULL COMMENT 'Первые строчки результатов поиска',
  `vip_block` tinyint(1) unsigned NOT NULL COMMENT 'Промоблок в результатах поиска',
  `first_place` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Описание услуги',
  `price` decimal(7,2) NOT NULL COMMENT 'Цена услуги',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Услуги продвижения';

#
# TABLE STRUCTURE FOR: ads_type
#

DROP TABLE IF EXISTS `ads_type`;

CREATE TABLE `ads_type` (
  `id` int(10) unsigned NOT NULL COMMENT 'Номер типа объявления',
  `ad_type` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Тип объявления',
  PRIMARY KEY (`id`),
  UNIQUE KEY `ad_type` (`ad_type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Типы объявлений';

#
# TABLE STRUCTURE FOR: catalog
#

DROP TABLE IF EXISTS `catalog`;

CREATE TABLE `catalog` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Номер каталога',
  `category` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Название категории',
  `subcategory` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Название подкатегории',
  `product` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Название продукта',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Каталог товаров';

#
# TABLE STRUCTURE FOR: extra_services
#

DROP TABLE IF EXISTS `extra_services`;

CREATE TABLE `extra_services` (
  `id` int(10) unsigned NOT NULL COMMENT 'Номер дополнительной услуги',
  `services_name` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название дополнительной услуги',
  `services_description` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'Описание дополнительной услуги',
  `price` decimal(7,2) NOT NULL COMMENT 'Цена дополнительной услуги',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Талица с дополнительными услугами';

#
# TABLE STRUCTURE FOR: media
#

DROP TABLE IF EXISTS `media`;

CREATE TABLE `media` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Номер медиафайла',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Номер пользователя',
  `image_type` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Тип картинки',
  `image` blob NOT NULL COMMENT 'Изображение',
  `image_size` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Размер изображения',
  `image_name` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название изображения',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Хранение фотографий товаров';



#
# TABLE STRUCTURE FOR: messages
#

DROP TABLE IF EXISTS `messages`;

CREATE TABLE `messages` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Номер сообщения',
  `from_user_id` int(10) unsigned NOT NULL COMMENT 'Номер отправителя сообщения',
  `to_user_id` int(10) unsigned NOT NULL COMMENT 'Номер получателя сообщения',
  `body` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'Текст сообщения',
  `is_delivered` tinyint(1) DEFAULT NULL COMMENT 'Статус доставки сообщения',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Дата отправления сообщения',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1501 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Сообщения';



#
# TABLE STRUCTURE FOR: product_shape
#

DROP TABLE IF EXISTS `product_shape`;

CREATE TABLE `product_shape` (
  `id` int(10) unsigned NOT NULL COMMENT 'Номер состояния товара',
  `shape_type` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Состояние товара',
  PRIMARY KEY (`id`),
  UNIQUE KEY `shape_type` (`shape_type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Таблица состояний товара';

#
# TABLE STRUCTURE FOR: profil
#

DROP TABLE IF EXISTS `profil`;

CREATE TABLE `profil` (
  `user_id` int(10) unsigned NOT NULL COMMENT 'Номер пользователя',
  `email` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Электронная почта',
  `city` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Город',
  `metro_station` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Станция метро',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Дата обновления профиля',
  `user_status` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Статус пользователя',
  `vk_profil` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Профиль вконтакте',
  `user_rating` float(3,1) DEFAULT NULL COMMENT 'Рейтинг пользователя',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Профиль пользователя';



#
# TABLE STRUCTURE FOR: remove_comment
#

DROP TABLE IF EXISTS `remove_comment`;

CREATE TABLE `remove_comment` (
  `id` int(10) unsigned NOT NULL COMMENT 'Номер причины',
  `comment_name` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Причина снятия объявления',
  PRIMARY KEY (`id`),
  UNIQUE KEY `comment_name` (`comment_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Список возможных причин снятия объявлений';

#
# TABLE STRUCTURE FOR: user
#

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Номер пользователя',
  `profile_name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Имя для профиля',
  `phone` varchar(120) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Номер мобильного',
  `user_password` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Пароль пользователя',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Дата регистрации пользователя',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Регистрационная форма';



#
# TABLE STRUCTURE FOR: user_ads
#

DROP TABLE IF EXISTS `user_ads`;

CREATE TABLE `user_ads` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Номер обявления',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Номер пользователя',
  `ads_name` varchar(120) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Название объявления',
  `product_shape_id` int(11) DEFAULT NULL COMMENT 'Номер состояния товара',
  `ads_type_id` int(11) DEFAULT NULL COMMENT 'Номер типа объявления',
  `catalog_id` int(10) unsigned NOT NULL COMMENT 'Номер группы товара',
  `ads_description` text COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Описание объявления',
  `price` decimal(10,2) DEFAULT NULL COMMENT 'Цена товара',
  `media_id` int(11) DEFAULT NULL COMMENT 'Номер фотографии',
  `youtube_link` varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Ссылка на видео',
  `trade_place` varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Место сделки',
  `ads_services_id` int(11) NOT NULL COMMENT 'Номер платной услуги',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Дата создания объявления',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Дата обновления объявления',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2001 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Таблица объявлений';



#
# TABLE STRUCTURE FOR: wallet
#

DROP TABLE IF EXISTS `wallet`;

CREATE TABLE `wallet` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Номер кошелька',
  `user_id` int(11) NOT NULL COMMENT 'Номер пользователя',
  `total` decimal(11,2) DEFAULT NULL COMMENT 'Сумма кошелька',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Кошелёк авито';



#
# TABLE STRUCTURE FOR: wallet_payment
#

DROP TABLE IF EXISTS `wallet_payment`;

CREATE TABLE `wallet_payment` (
  `id` int(10) unsigned NOT NULL COMMENT 'Номер способа пополнения кошелька',
  `payment_method` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Способ пополнения кошелька',
  `url_method` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Ссылка на сервис пополнения',
  PRIMARY KEY (`id`),
  UNIQUE KEY `payment_method` (`payment_method`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Пополнение кошелька';

